import React from 'react';

function App() {
  return (
    <div className="App">
      <nav>
        <div className="nav-wrapper">
          <a href="/" className="brand-logo">Logo</a>
          <ul id="nav-mobile" className="right hide-on-med-and-down">
            <li><a href="/">Sass</a></li>
            <li><a href="/">Components</a></li>
          </ul>
        </div>
      </nav>
    </div>
  );
}

export default App;
